import React, { useState } from "react";
import { signInWithEmailAndPassword, signInWithPopup } from "firebase/auth";
import { auth, provider } from "./Firebase";

import { NavLink, useNavigate } from "react-router-dom";

const Login = () => {
  const navigate = useNavigate();
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");

  const onLogin = (e) => {
    e.preventDefault();
    signInWithEmailAndPassword(auth, email, password)
      .then((userCredential) => {
        // Signed in
        const user = userCredential.user;
        navigate("/");
        console.log(user);
      })
      .catch((error) => {
        alert("Invalid email or password");
        const errorCode = error.code;
        const errorMessage = error.message;
        console.log(errorCode, errorMessage);
      });
  };

  const onGoogleLogin = (e) => {
    e.preventDefault();
    signInWithPopup(auth, provider)
      .then((result) => {
        // This gives you a Google Access Token. You can use it to access the Google API.
        navigate("/");
      })
      .catch((error) => {
        // Handle Errors here.
        const errorCode = error.code;
        const errorMessage = error.message;
        console.log(errorCode, errorMessage);
      });
  };

  return (
    <>
    <main className="main-container">
      <section className="login-section">
      <div className="register-container">
  <div className="register-header">
    <h2>Try [YourApp] free for 14 days</h2>
    <p>No credit card needed. Unlimited use. No commitment.</p>
  </div>

  <div className="register-body">
    <button className="google-register">Register with Google</button>
    <div className="divider">
      <span>Or</span>
    </div>

    <form className="register-form">
      <input type="text" id="name" name="name" placeholder="Name" required />
      <input type="email" id="email" name="email" placeholder="E-mail address" required />
      <input type="password" id="password" name="password" placeholder="Password" required />
      <button type="submit" className="start-trial">Start your 14 days trial</button>
    </form>

    <p className="terms">
      By continuing you accept these <a href="#">Terms</a>, <a href="#">Data Policy</a> and <a href="#">Cookies Policy</a>.
    </p>
  </div>
</div>

      </section>
    </main>
  </>  
  );
};

export default Login;
